    top : "0",

  };

  const position = {
    lat: 34.48520833, 
    lng: 136.8251525
  };

  return (
    <div className="wrap">
      <LoadScript googleMapsApiKey="AIzaSyCjpcBI57XAEzvIqzNBEj4eIpVzRaRe93U">
        <GoogleMap mapContainerStyle={container} center={position} zoom={15}>
        </GoogleMap>
      </LoadScript>
    </div>
  )
}
